import React, { Component } from 'react';
import Box from './box'

class Board extends Component {
  constructor(props){
    super(props)

    this.state = {
      boxArr: Array(9)
    }
  }
  render() {
    let { boxArr } = this.state
    let boxes = boxArr.map((box,i) => {
      return box = <Box key={i} />
    })

    return (
      <div className="board">
        {boxes}
      </div>
    );
  }
}

export default Board;
